pragma solidity ^0.6.0;
pragma experimental ABIEncoderV2;

contract Banco{

    struct cliente{
        string _nombre;
        address drieccion;
        uint dinero;
    }

    mapping (string => cliente) clientes;

    function crearCliente(string memory _nombre) public {
        clientes[_nombre] = cliente(_nombre, msg.sender, 0);
    }

}
